import React, { useState, useEffect, useRef } from 'react';
import './landingPage.css'; // You'll need to create this CSS file with the styles

const NeuralChatLanding = () => {
    // Background Components
    const FloatingParticles = () => (
        <div className="floating-particles fixed inset-0 pointer-events-none">
            {[...Array(9)].map((_, i) => (
                <div key={i} className="particle"></div>
            ))}
        </div>
    );

    const NeuralNetwork = () => (
        <div className="neural-network fixed inset-0 pointer-events-none">
            <svg width="100%" height="100%" viewBox="0 0 1000 1000">
                <defs>
                    <pattern id="grid" width="50" height="50" patternUnits="userSpaceOnUse">
                        <path d="M 50 0 L 0 0 0 50" fill="none" stroke="rgba(114, 9, 183, 0.1)" strokeWidth="1"/>
                    </pattern>
                </defs>
                <rect width="100%" height="100%" fill="url(#grid)" />
            </svg>
        </div>
    );

    // Navigation Component
    const Navigation = () => {
        const [scrolled, setScrolled] = useState(false);

        useEffect(() => {
            const handleScroll = () => {
                setScrolled(window.scrollY > 100);
            };
            window.addEventListener('scroll', handleScroll);
            return () => window.removeEventListener('scroll', handleScroll);
        }, []);

        const scrollToSection = (sectionId) => {
            document.getElementById(sectionId)?.scrollIntoView({ behavior: 'smooth' });
        };

        const openLoginPage = () => {
            alert('This would redirect to the login/signup page in a real React application!');
        };

        return (
            <nav className={`navbar fixed top-0 w-full z-50 px-6 py-4 transition-all duration-300 ${scrolled ? 'bg-opacity-95' : 'bg-opacity-90'}`}>
                <div className="max-w-7xl mx-auto flex items-center justify-between">
                    <div className="flex items-center space-x-3">
                        <div className="ai-logo w-12 h-12 rounded-xl flex items-center justify-center">
                            <i className="fas fa-brain text-white text-xl"></i>
                        </div>
                        <span className="text-2xl font-bold gradient-text">NeuralChat AI</span>
                    </div>

                    <div className="hidden md:flex items-center space-x-8">
                        <button onClick={() => scrollToSection('features')} className="text-white hover:text-purple-400 transition-colors duration-300">Features</button>
                        <button onClick={() => scrollToSection('pricing')} className="text-white hover:text-purple-400 transition-colors duration-300">Pricing</button>
                        <button onClick={() => scrollToSection('about')} className="text-white hover:text-purple-400 transition-colors duration-300">About</button>
                        <button onClick={() => scrollToSection('contact')} className="text-white hover:text-purple-400 transition-colors duration-300">Contact</button>
                    </div>

                    <div className="flex items-center space-x-4">
                        <button onClick={openLoginPage} className="btn-secondary px-6 py-2 rounded-xl font-semibold">
                            <i className="fas fa-sign-in-alt mr-2"></i>Login
                        </button>
                        <button onClick={openLoginPage} className="btn-primary px-6 py-2 rounded-xl font-semibold">
                            <i className="fas fa-rocket mr-2"></i>Get Started
                        </button>
                    </div>
                </div>
            </nav>
        );
    };

    // Typing Animation Hook
    const useTypingAnimation = () => {
        const [text, setText] = useState('');
        const [isDeleting, setIsDeleting] = useState(false);
        const [phraseIndex, setPhraseIndex] = useState(0);

        const phrases = [
            "Write code in any language",
            "Generate creative content",
            "Solve complex problems",
            "Analyze data insights",
            "Create marketing strategies",
            "Debug and optimize code"
        ];

        useEffect(() => {
            const currentPhrase = phrases[phraseIndex];
            let timeout;

            if (isDeleting) {
                timeout = setTimeout(() => {
                    setText(currentPhrase.substring(0, text.length - 1));
                    if (text.length === 1) {
                        setIsDeleting(false);
                        setPhraseIndex((prev) => (prev + 1) % phrases.length);
                    }
                }, 50);
            } else {
                timeout = setTimeout(() => {
                    setText(currentPhrase.substring(0, text.length + 1));
                    if (text === currentPhrase) {
                        setTimeout(() => setIsDeleting(true), 2000);
                    }
                }, 100);
            }

            return () => clearTimeout(timeout);
        }, [text, isDeleting, phraseIndex, phrases]);

        return text;
    };

    // Stats Counter Hook
    const useCounter = (target, isVisible) => {
        const [count, setCount] = useState(0);

        useEffect(() => {
            if (!isVisible) return;

            const increment = target / 100;
            let current = 0;
            const timer = setInterval(() => {
                current += increment;
                if (current >= target) {
                    current = target;
                    clearInterval(timer);
                }
                setCount(Math.floor(current));
            }, 50);

            return () => clearInterval(timer);
        }, [target, isVisible]);

        return count;
    };

    // Stats Component
    const StatsCounter = ({ target, suffix, label }) => {
        const [isVisible, setIsVisible] = useState(false);
        const ref = useRef();
        const count = useCounter(target, isVisible);

        useEffect(() => {
            const observer = new IntersectionObserver(
                ([entry]) => setIsVisible(entry.isIntersecting),
                { threshold: 0.1 }
            );
            if (ref.current) observer.observe(ref.current);
            return () => observer.disconnect();
        }, []);

        const formatCount = (num) => {
            if (target >= 1000000) return (num / 1000000).toFixed(1) + 'M+';
            if (target >= 1000) return (num / 1000).toFixed(0) + 'K+';
            return num + suffix;
        };

        return (
            <div ref={ref} className="text-center">
                <div className="stats-counter">{formatCount(count)}</div>
                <p className="text-white text-opacity-80">{label}</p>
            </div>
        );
    };

    // Hero Section Component
    const HeroSection = () => {
        const typingText = useTypingAnimation();
        const openLoginPage = () => {
            alert('This would redirect to the login/signup page in a real React application!');
        };

        const scrollToFeatures = () => {
            document.getElementById('features')?.scrollIntoView({ behavior: 'smooth' });
        };

        return (
            <section className="min-h-screen flex items-center justify-center relative px-6 pt-20">
                <div className="max-w-7xl mx-auto text-center relative z-10">
                    <div className="mb-8">
                        <div className="ai-logo w-24 h-24 rounded-2xl flex items-center justify-center mx-auto mb-6">
                            <i className="fas fa-brain text-white text-4xl"></i>
                        </div>
                        <h1 className="text-6xl md:text-8xl font-black mb-6 leading-tight">
                            <span className="gradient-text">Neural</span><span className="text-white">Chat</span>
                            <br />
                            <span className="text-white">AI</span>
                        </h1>
                        <p className="text-xl md:text-2xl text-white text-opacity-90 mb-4 max-w-3xl mx-auto">
                            Experience the future of AI conversation with our next-generation neural network technology
                        </p>
                        <div className="text-lg text-purple-300 mb-8 h-8">
                            <span className="typing-animation">{typingText}</span>
                        </div>
                    </div>

                    <div className="flex flex-col sm:flex-row items-center justify-center space-y-4 sm:space-y-0 sm:space-x-6 mb-12">
                        <button onClick={openLoginPage} className="btn-primary px-8 py-4 rounded-2xl font-semibold text-lg">
                            <i className="fas fa-rocket mr-3"></i>Start Free Trial
                        </button>
                        <button onClick={scrollToFeatures} className="btn-secondary px-8 py-4 rounded-2xl font-semibold text-lg">
                            <i className="fas fa-play mr-3"></i>Watch Demo
                        </button>
                    </div>

                    <div className="grid grid-cols-2 md:grid-cols-4 gap-8 max-w-4xl mx-auto">
                        <StatsCounter target={1000000} suffix="+" label="Active Users" />
                        <StatsCounter target={50000000} suffix="+" label="Messages Processed" />
                        <StatsCounter target={99} suffix="%" label="Accuracy Rate" />
                        <StatsCounter target={24} suffix="+" label="Languages Supported" />
                    </div>
                </div>

                <div className="scroll-indicator">
                    <i className="fas fa-chevron-down text-white text-2xl opacity-60"></i>
                </div>

                {/* Floating Chat Bubbles */}
                <div className="absolute top-1/4 left-10 chat-bubble rounded-2xl p-4 max-w-xs hidden lg:block">
                    <p className="text-sm text-white">"How can I optimize my code?"</p>
                </div>
                <div className="absolute top-1/3 right-10 chat-bubble rounded-2xl p-4 max-w-xs hidden lg:block" style={{animationDelay: '1s'}}>
                    <p className="text-sm text-white">"Generate a marketing strategy for my startup"</p>
                </div>
                <div className="absolute bottom-1/3 left-20 chat-bubble rounded-2xl p-4 max-w-xs hidden lg:block" style={{animationDelay: '2s'}}>
                    <p className="text-sm text-white">"Explain quantum computing in simple terms"</p>
                </div>
            </section>
        );
    };

    // Feature Card Component
    const FeatureCard = ({ icon, title, description, gradient }) => (
        <div className="feature-card rounded-3xl p-8 section-fade-in">
            <div className={`w-16 h-16 bg-gradient-to-r ${gradient} rounded-2xl flex items-center justify-center mb-6`}>
                <i className={`${icon} text-white text-2xl`}></i>
            </div>
            <h3 className="text-2xl font-bold mb-4">{title}</h3>
            <p className="text-white text-opacity-80 leading-relaxed">{description}</p>
        </div>
    );

    // Features Section Component
    const FeaturesSection = () => {
        const features = [
            {
                icon: "fas fa-comments",
                title: "Natural Conversations",
                description: "Engage in human-like conversations with advanced context understanding and emotional intelligence.",
                gradient: "from-blue-500 to-purple-600"
            },
            {
                icon: "fas fa-code",
                title: "Code Generation",
                description: "Generate, debug, and optimize code in 50+ programming languages with intelligent suggestions.",
                gradient: "from-green-500 to-blue-500"
            },
            {
                icon: "fas fa-lightbulb",
                title: "Creative Solutions",
                description: "Unlock creative potential with AI-powered brainstorming, content creation, and problem-solving.",
                gradient: "from-purple-500 to-pink-500"
            },
            {
                icon: "fas fa-shield-alt",
                title: "Enterprise Security",
                description: "Bank-level encryption, data privacy compliance, and secure cloud infrastructure for peace of mind.",
                gradient: "from-orange-500 to-red-500"
            },
            {
                icon: "fas fa-globe",
                title: "Multi-Language",
                description: "Communicate seamlessly in 24+ languages with real-time translation and cultural context awareness.",
                gradient: "from-teal-500 to-green-500"
            },
            {
                icon: "fas fa-plug",
                title: "API Integration",
                description: "Seamlessly integrate with your existing tools and workflows through our powerful REST API.",
                gradient: "from-indigo-500 to-purple-500"
            }
        ];

        return (
            <section id="features" className="py-20 px-6 relative z-10">
                <div className="max-w-7xl mx-auto">
                    <div className="text-center mb-16 section-fade-in">
                        <h2 className="text-5xl font-bold mb-6">
                            <span className="gradient-text">Powerful Features</span>
                        </h2>
                        <p className="text-xl text-white text-opacity-80 max-w-3xl mx-auto">
                            Discover the cutting-edge capabilities that make NeuralChat AI the most advanced conversational AI platform
                        </p>
                    </div>

                    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                        {features.map((feature, index) => (
                            <FeatureCard key={index} {...feature} />
                        ))}
                    </div>
                </div>
            </section>
        );
    };

    // Pricing Card Component
    const PricingCard = ({ title, price, description, features, buttonText, featured = false }) => {
        const openLoginPage = () => {
            alert('This would redirect to the signup page in a real React application!');
        };

        const contactSales = () => {
            alert('This would open a contact form in a real React application!');
        };

        return (
            <div className={`pricing-card rounded-3xl p-8 section-fade-in ${featured ? 'featured transform scale-105' : ''}`}>
                <div className="text-center mb-8">
                    {featured && (
                        <div className="bg-gradient-to-r from-purple-600 to-blue-600 text-white px-4 py-2 rounded-full text-sm font-semibold mb-4 inline-block">
                            Most Popular
                        </div>
                    )}
                    <h3 className="text-2xl font-bold mb-4">{title}</h3>
                    <div className="text-4xl font-bold mb-2">
                        {price}
                        {price !== 'Custom' && price !== 'Free' && <span className="text-lg font-normal">/month</span>}
                    </div>
                    <p className="text-white text-opacity-80">{description}</p>
                </div>
                <ul className="space-y-4 mb-8">
                    {features.map((feature, index) => (
                        <li key={index} className="flex items-center">
                            <i className="fas fa-check text-green-400 mr-3"></i>
                            <span>{feature}</span>
                        </li>
                    ))}
                </ul>
                <button 
                    onClick={buttonText === 'Contact Sales' ? contactSales : openLoginPage}
                    className={`w-full py-4 rounded-2xl font-semibold ${featured ? 'btn-primary' : 'btn-secondary'}`}
                >
                    {buttonText}
                </button>
            </div>
        );
    };

    // Pricing Section Component
    const PricingSection = () => {
        const plans = [
            {
                title: "Starter",
                price: "Free",
                description: "Perfect for individuals",
                features: [
                    "100 messages per month",
                    "Basic AI models",
                    "Web interface",
                    "Community support"
                ],
                buttonText: "Get Started Free"
            },
            {
                title: "Pro",
                price: "$29",
                description: "For professionals and teams",
                features: [
                    "Unlimited messages",
                    "Advanced AI models",
                    "API access",
                    "Priority support",
                    "Custom integrations"
                ],
                buttonText: "Start Pro Trial",
                featured: true
            },
            {
                title: "Enterprise",
                price: "Custom",
                description: "For large organizations",
                features: [
                    "Unlimited everything",
                    "Custom AI models",
                    "On-premise deployment",
                    "24/7 dedicated support",
                    "SLA guarantee"
                ],
                buttonText: "Contact Sales"
            }
        ];

        return (
            <section id="pricing" className="py-20 px-6 relative z-10">
                <div className="max-w-7xl mx-auto">
                    <div className="text-center mb-16 section-fade-in">
                        <h2 className="text-5xl font-bold mb-6">
                            <span className="gradient-text">Simple Pricing</span>
                        </h2>
                        <p className="text-xl text-white text-opacity-80 max-w-3xl mx-auto">
                            Choose the perfect plan for your needs. Start free and scale as you grow.
                        </p>
                    </div>

                    <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-6xl mx-auto">
                        {plans.map((plan, index) => (
                            <PricingCard key={index} {...plan} />
                        ))}
                    </div>
                </div>
            </section>
        );
    };

    // Testimonial Component
    const TestimonialCard = ({ name, role, content, initials }) => (
        <div className="testimonial-card rounded-3xl p-8 section-fade-in">
            <div className="flex items-center mb-6">
                <div className="w-12 h-12 bg-gradient-to-r from-blue-500 to-purple-600 rounded-full flex items-center justify-center mr-4">
                    <span className="text-white font-bold">{initials}</span>
                </div>
                <div>
                    <h4 className="font-semibold">{name}</h4>
                    <p className="text-white text-opacity-60 text-sm">{role}</p>
                </div>
            </div>
            <p className="text-white text-opacity-90 leading-relaxed">{content}</p>
            <div className="flex text-yellow-400 mt-4">
                {[...Array(5)].map((_, i) => (
                    <i key={i} className="fas fa-star"></i>
                ))}
            </div>
        </div>
    );

    // Testimonials Section Component
    const TestimonialsSection = () => {
        const testimonials = [
            {
                name: "Sarah Johnson",
                role: "Software Engineer",
                content: "NeuralChat AI has revolutionized my coding workflow. The code generation is incredibly accurate and saves me hours every day.",
                initials: "SJ"
            },
            {
                name: "Michael Chen",
                role: "Marketing Director",
                content: "The creative capabilities are mind-blowing. It helps me generate campaign ideas and content that truly resonates with our audience.",
                initials: "MC"
            },
            {
                name: "Emily Rodriguez",
                role: "Research Scientist",
                content: "As a researcher, I need accurate and detailed information. NeuralChat AI consistently delivers high-quality insights for my work.",
                initials: "ER"
            }
        ];

        return (
            <section className="py-20 px-6 relative z-10">
                <div className="max-w-7xl mx-auto">
                    <div className="text-center mb-16 section-fade-in">
                        <h2 className="text-5xl font-bold mb-6">
                            <span className="gradient-text">What Our Users Say</span>
                        </h2>
                        <p className="text-xl text-white text-opacity-80 max-w-3xl mx-auto">
                            Join thousands of satisfied users who have transformed their workflow with NeuralChat AI
                        </p>
                    </div>

                    <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
                        {testimonials.map((testimonial, index) => (
                            <TestimonialCard key={index} {...testimonial} />
                        ))}
                    </div>
                </div>
            </section>
        );
    };

    // CTA Section Component
    const CTASection = () => {
        const openLoginPage = () => {
            alert('This would redirect to the signup page in a real React application!');
        };

        const contactSales = () => {
            alert('This would open a contact form in a real React application!');
        };

        return (
            <section className="py-20 px-6 relative z-10">
                <div className="max-w-4xl mx-auto text-center section-fade-in">
                    <div className="glass-morphism rounded-3xl p-12">
                        <h2 className="text-5xl font-bold mb-6">
                            Ready to Experience the <span className="gradient-text">Future</span>?
                        </h2>
                        <p className="text-xl text-white text-opacity-90 mb-8 max-w-2xl mx-auto">
                            Join millions of users who are already transforming their work with NeuralChat AI. Start your free trial today.
                        </p>
                        <div className="flex flex-col sm:flex-row items-center justify-center space-y-4 sm:space-y-0 sm:space-x-6">
                            <button onClick={openLoginPage} className="btn-primary px-8 py-4 rounded-2xl font-semibold text-lg">
                                <i className="fas fa-rocket mr-3"></i>Start Free Trial
                            </button>
                            <button onClick={contactSales} className="btn-secondary px-8 py-4 rounded-2xl font-semibold text-lg">
                                <i className="fas fa-phone mr-3"></i>Talk to Sales
                            </button>
                        </div>
                    </div>
                </div>
            </section>
        );
    };

    // Footer Component
    const Footer = () => (
        <footer className="py-12 px-6 border-t border-white border-opacity-10 relative z-10">
            <div className="max-w-7xl mx-auto">
                <div className="grid grid-cols-1 md:grid-cols-4 gap-8 mb-8">
                    <div>
                        <div className="flex items-center space-x-3 mb-4">
                            <div className="ai-logo w-10 h-10 rounded-lg flex items-center justify-center">
                                <i className="fas fa-brain text-white text-lg"></i>
                            </div>
                            <span className="text-xl font-bold gradient-text">NeuralChat AI</span>
                        </div>
                        <p className="text-white text-opacity-80 leading-relaxed">
                            The next-generation AI assistant that understands, creates, and innovates with you.
                        </p>
                    </div>

                    <div>
                        <h4 className="font-semibold mb-4">Product</h4>
                        <ul className="space-y-2 text-white text-opacity-80">
                            <li><a href="#features" className="hover:text-purple-400 transition-colors">Features</a></li>
                            <li><a href="#pricing" className="hover:text-purple-400 transition-colors">Pricing</a></li>
                            <li><a href="#" className="hover:text-purple-400 transition-colors">API</a></li>
                            <li><a href="#" className="hover:text-purple-400 transition-colors">Documentation</a></li>
                        </ul>
                    </div>

                    <div>
                        <h4 className="font-semibold mb-4">Company</h4>
                        <ul className="space-y-2 text-white text-opacity-80">
                            <li><a href="#" className="hover:text-purple-400 transition-colors">About</a></li>
                            <li><a href="#" className="hover:text-purple-400 transition-colors">Blog</a></li>
                            <li><a href="#" className="hover:text-purple-400 transition-colors">Careers</a></li>
                            <li><a href="#" className="hover:text-purple-400 transition-colors">Contact</a></li>
                        </ul>
                    </div>

                    <div>
                        <h4 className="font-semibold mb-4">Connect</h4>
                        <div className="flex space-x-4">
                            <a href="#" className="w-10 h-10 bg-white bg-opacity-10 rounded-lg flex items-center justify-center hover:bg-opacity-20 transition-all">
                                <i className="fab fa-twitter text-white"></i>
                            </a>
                            <a href="#" className="w-10 h-10 bg-white bg-opacity-10 rounded-lg flex items-center justify-center hover:bg-opacity-20 transition-all">
                                <i className="fab fa-linkedin text-white"></i>
                            </a>
                            <a href="#" className="w-10 h-10 bg-white bg-opacity-10 rounded-lg flex items-center justify-center hover:bg-opacity-20 transition-all">
                                <i className="fab fa-github text-white"></i>
                            </a>
                        </div>
                    </div>
                </div>

                <div className="border-t border-white border-opacity-10 pt-8 text-center text-white text-opacity-60">
                    <p>&copy; 2024 NeuralChat AI. All rights reserved. | Privacy Policy | Terms of Service</p>
                </div>
            </div>
        </footer>
    );

    // Intersection Observer Hook for Animations
    const useIntersectionObserver = () => {
        useEffect(() => {
            const observer = new IntersectionObserver(
                (entries) => {
                    entries.forEach(entry => {
                        if (entry.isIntersecting) {
                            entry.target.classList.add('visible');
                        }
                    });
                },
                { threshold: 0.1, rootMargin: '0px 0px -50px 0px' }
            );

            document.querySelectorAll('.section-fade-in').forEach(el => {
                observer.observe(el);
            });

            return () => observer.disconnect();
        }, []);
    };

    // Use the intersection observer
    useIntersectionObserver();

    return (
        <div className="animated-bg text-white overflow-x-hidden">
            <FloatingParticles />
            <NeuralNetwork />
            <Navigation />
            <HeroSection />
            <FeaturesSection />
            <PricingSection />
            <TestimonialsSection />
            <CTASection />
            <Footer />
        </div>
    );
};

export default NeuralChatLanding;
